import React from 'react';
// import Jancok from './Jancok';

const Keranjang = ({keranjangPost}) => {

	return (
		<div className="container-keranjang">
			{keranjangPost && keranjangPost.map(keranjangs => {
				return(
					<div key={keranjangs.product.id}>
						<span className="keranjang-top">
							<span className="tambah-kurang">
								<span >-</span>
								<h3>{keranjangs.jumlah}</h3>
								<span>+</span>
							</span>
							<h2>{keranjangs.product.nama}</h2>
						</span>
						<h2 className="harga">Rp {new Intl.NumberFormat("de-DE").format(keranjangs.total_harga)}</h2>
					</div>
				)
			})}

		</div>
	)
};

export default Keranjang;
